s($,"b7h","aIR",()=>A.a([A.vK("Williams is an ultra-talented quarterback prospect with rare arm talent and improvisational ability. He combines elite arm strength with the ability to deliver from multiple arm angles and platforms. His creativity under pressure and natural playmaking ability draw comparisons to Patrick Mahomes. Williams displays exceptional pocket awareness, escapability, and the ability to extend plays while keeping his eyes downfield. His ball placement and accuracy are plus traits, particularly when throwing on the move.",73,"Caleb Williams","QB",9.2,"Elite arm talent, exceptional creativity, natural playmaker, high-level pocket awareness, pinpoint accuracy on the move, competitive leadership","Can be overly reliant on off-platform throws, occasional hero-ball tendencies, needs refinement in progression reads, can hold the ball too long seeking big plays",214),A.vK("Maye possesses prototypical size and arm talent for the quarterback position with excellent mobility to extend plays. He's shown consistent improvement in his processing speed and decision-making. His arm strength allows him to make all NFL throws with velocity and touch when needed. Maye demonstrates good anticipation and timing, especially on intermediate routes, and has the athletic ability to be a legitimate threat in the designed run game and on scrambles.",76,"Drake Maye","QB",9,"Prototypical size, excellent arm strength, advanced processing for age, plus athleticism, leadership qualities, competitive toughness","Occasional mechanical inconsistencies, can force throws into tight windows, needs to improve eye discipline, footwork can break down under pressure",223),A.vK("Nabers is an explosive playmaker at the receiver position with exceptional route-running ability and separation skills. He possesses elite acceleration and change-of-direction ability that makes him a threat to score from anywhere on the field. His body control and ability to adjust to the ball in the air are high-end traits. After the catch, Nabers becomes a running back with vision, elusiveness, and contact balance to break tackles and create big plays.",72,"Malik Nabers","WR",9.4,"Elite acceleration, refined route runner, excellent hands, tremendous YAC ability, competitive toughness, positional versatility","Slightly undersized frame, occasional concentration drops, could improve strength against press coverage, limited contested catch experience",200),A.vK("Harrison Jr. possesses a rare combination of size, speed, route-running precision, and ball skills. The son of Hall of Fame receiver Marvin Harrison, he shows advanced technical refinement for his age with razor-sharp routes and excellent footwork. His body control and sideline awareness are elite, and he consistently demonstrates strong hands to pluck the ball away from his frame. Harrison's catch radius and ability to high-point the football make him a red-zone threat and reliable target at all three levels.",75,"Marvin Harrison Jr.","WR",9.1,"Refined route technician, excellent hands and catch radius, body control and sideline awareness, high football IQ, red-zone effectiveness, competitive mentality","Could improve play strength through contact, occasionally struggles with physicality against press, may need to expand route tree at next level",209),A.vK("Turner is an explosive edge defender with elite get-off and bend around the corner. His first-step quickness allows him to consistently pressure offensive tackles before they can set, and his ankle flexibility to flatten to the quarterback is a premium trait. Turner converts speed to power effectively and shows multiple counter moves when his initial rush is stopped. His motor runs hot, and he pursues plays with relentless effort. In run defense, he sets a firm edge with good hand placement and leverage.",75,"Dallas Turner","EDGE",9.3,"Elite first-step explosion, excellent bend and flexibility, developed hand usage, high motor, improving run defender, scheme versatility","Could add functional strength, occasionally plays too high, needs to expand counter-move arsenal, can get washed out by double teams in run game",247),A.vK("Fashanu is a technically refined offensive tackle prospect with exceptional athleticism for his size. His quick feet and lateral mobility make him a natural pass protector on the blind side. He displays textbook hand placement and timing in pass protection, rarely getting caught out of position. As a run blocker, Fashanu shows the power to drive defenders off the ball and the mobility to excel in zone schemes. His football IQ is evident in how he handles stunts, twists, and blitzes.",78,"Olu Fashanu","OT",9.5,"Elite athleticism, technical refinement, exceptional lateral agility, strong anchor, hand usage and timing, positional versatility, high football IQ","Could play with more consistent nasty streak, occasional issues with speed-to-power conversions, needs to improve hand placement consistency",312),A.vK("Mitchell is a technically refined cornerback with outstanding ball skills and route recognition. His change-of-direction ability and fluidity in his hips allow him to mirror receivers in man coverage with ease. In zone coverage, Mitchell shows excellent pattern reading and anticipation to jump routes and create turnovers. He's a willing tackler who takes good angles in run support and limits yards after catch. His competitive nature and football intelligence make him scheme-versatile at the next level.",72,"Quinyon Mitchell","CB",8.9,"Exceptional route recognition, fluid hips, ball skills, competitive toughness, versatile coverage ability, high football IQ, reliable tackler","Could add functional strength, occasional inconsistency in press technique, may struggle with larger receivers, limited experience against elite competition",195)],A.b0("C<m_>")))
